$EncodedCompressedFile = ''
$DeflatedStream = New-Object IO.Compression.DeflateStream([IO.MemoryStream][Convert]::FromBase64String($EncodedCompressedFile),[IO.Compression.CompressionMode]::Decompress)
$UncompressedFileBytes = New-Object Byte[](161280)
$DeflatedStream.Read($UncompressedFileBytes, 0, 161280) | Out-Null
$null = [Reflection.Assembly]::Load($UncompressedFileBytes)

$Assembly=([System.AppDomain]::CurrentDomain.GetAssemblies()|? FullName -Match "PowerForensics")[0]
Import-Module -Assembly $Assembly
